features.script:
let textSign = parcel.getFeatureById('triggerResult')

feature.on('click',e=>{
    textSign.set({text:'dm us on ig/twitter!!'})
})

let closed = false

feature.on('click',e=>{

  if(closed){
      feature.position.x=-1.05
  }else{
      feature.position.x=0.15

  }
closed=!closed
})
